"""##Data Pre Processing"""

#print datatypes of each column
df.dtypes

#split the target as y
X=df.drop('poisonous',axis='columns')
y=df['poisonous']

X

[[y]]

df.isnull().sum() #get missing values in each column

df['stalk-root']=df['stalk-root'].fillna(df['stalk-root'].mode()[0]) #fill missing values with most frequent occurence in column

df.isnull().sum()

X

# Identify categorical columns
categorical_features = X.select_dtypes(include=['object']).columns

# Initialize OneHotEncoder
one_hot_encoder = OneHotEncoder(sparse_output=False)

# Fit and transform the data
X_transformed = one_hot_encoder.fit_transform(X[categorical_features])

# Get feature names after one-hot encoding
one_hot_feature_names = one_hot_encoder.get_feature_names_out(categorical_features)

# Convert the transformed data to a DataFrame
X_transformed_df = pd.DataFrame(X_transformed, columns=one_hot_feature_names, index=X.index)

"""##Training Model"""

X_transformed_df

X_train,X_test,y_train,y_test=train_test_split(X_transformed_df,y,test_size=0.2)

X_train

print(y_test)

y_train.head()

X_train.shape

y_train.shape

X_test.shape

model=DecisionTreeClassifier()
model.fit(X_train,y_train)

model_pred=model.predict(X_test)
model_pred

y_test

accuracy=accuracy_score(y_test,model_pred)
print("accuracy:",accuracy)

